import React from "react";

import city from "../../data/city.json";

const City = () => {
  return (
    <div className="container">
      {city.map((city) => (
        <div className="col">
          <img src={city.image} alt=""></img>
          <p>{city.name}</p>
        </div>
      ))}
    </div>
  );
};
export default City;
